/*** Volume ***/
  function RP_v5_isIE () {
    if (navigator.userAgent.indexOf('MSIE') !== -1 || navigator.appVersion.indexOf('Trident/') > 0) {
      return true;
    };
    return false;
  }
  function RP_v5_calculateVolume (el, e) {
    var slider = jQuery(RP_v5_playerID+'[data-id='+RP_v5_playerNumber+'] .rp-volume-control');
    var width = slider.width();
    var posX = el.offset().left;
    var value = (e.pageX - posX);
    RP_v5_volume = Math.round( (value * 100) / width );
    slider.css('background-position', value-width);
    uppodSend('RP_v5_uppod_'+RP_v5_playerNumber, 'v' + RP_v5_volume);
    if (RP_v5_debug) console.log('volume: ' + RP_v5_volume);
  }
  jQuery(RP_v5_playerID).on('mousedown', '.rp-volume-control', function(){
    RP_v5_clicking = true;
  });
  jQuery(document).on("mouseup", function(){
    RP_v5_clicking = false;
  });
  jQuery(RP_v5_playerID).on('click', '.rp-volume-control', function(e){
    RP_v5_playerNumber = jQuery(this).closest(RP_v5_playerID).attr('data-id');
    RP_v5_calculateVolume( jQuery(this), e );
  });
  jQuery(RP_v5_playerID).on('mousemove', '.rp-volume-control', function(e){
    RP_v5_playerNumber = jQuery(this).closest(RP_v5_playerID).attr('data-id');
    if ( RP_v5_clicking ) RP_v5_calculateVolume( jQuery(this), e );
  });

