//  JavaScript API 2.0 for Uppod 1+
//  http://uppod.ru/js
// Commands
function uppodSend(playerID,com,callback) {
  try{
    if (RP_v5_playerReady[RP_v5_playerNumber]) document.getElementById(playerID).sendToUppod(com);
  } catch(e) {
    if (RP_v5_debug) console.log("Uppod Send Error: "+e.name);
  };
}
// Requests
function uppodGet(playerID,com,callback) {
  try{
    if (RP_v5_playerReady[RP_v5_playerNumber]) return document.getElementById(playerID).getUppod(com);
  } catch(e) {
    if (RP_v5_debug) console.log("Uppod Send Error: "+e.name);
  };
}